import React from 'react';
import { Plus } from 'lucide-react';

const InterviewCreator = () => {
  return (
    <div className="space-y-6">
      <div>
        <h1 className="text-2xl font-bold text-gray-900">Create Interview</h1>
        <p className="mt-1 text-sm text-gray-500">
          Set up a new interview session with custom configurations
        </p>
      </div>

      <div className="card">
        <div className="text-center py-12">
          <Plus className="mx-auto h-12 w-12 text-gray-400" />
          <h3 className="mt-2 text-sm font-medium text-gray-900">Interview Creator</h3>
          <p className="mt-1 text-sm text-gray-500">
            This page will contain the interview creation form with all the required fields.
          </p>
          <div className="mt-6">
            <button className="btn-primary inline-flex items-center">
              <Plus className="h-4 w-4 mr-2" />
              Coming Soon
            </button>
          </div>
        </div>
      </div>
    </div>
  );
};

export default InterviewCreator;
